package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import java.util.Set;
import java.util.HashSet;

class VetTest {

	private Vet instance;

	@BeforeEach
	void setUp() {
		instance = new Vet();
	}

	@Test
	@DisplayName("Verifies that after adding a specialty, getSpecialtiesInternal returns the set containing that specialty")
	void testGetSpecialtiesInternalAfterAddingSpecialtyReturnsSetWithSpecialty() {
		Specialty specialty = new Specialty();
		instance.addSpecialty(specialty);
		var result = instance.getSpecialtiesInternal();
		assertEquals(Set.of(specialty), result);
	}

	@Test
	@DisplayName("Verifies that getSpecialtiesInternal returns the same instance when called multiple times")
	void testGetSpecialtiesInternalReturnsSameSetInstance() {
		var result = instance.getSpecialtiesInternal();
		assertSame(result, instance.getSpecialtiesInternal());
	}

}

