package org.springframework.samples.petclinic.owner;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import static org.junit.jupiter.api.Assertions.assertEquals;
import org.junit.jupiter.api.Test;

class OwnerTest {

	private Owner instance;

	@BeforeEach
	void setUp() {
		instance = new Owner();
	}

	@Test
	@DisplayName("Verifies that getAddress returns the address that was set")
	void testGetAddressReturnsSetValue() {
		instance.setAddress("123 Main St");
		var result = instance.getAddress();
		assertEquals("123 Main St", result);
	}

	@Test
	@DisplayName("Verifies that getAddress returns null when address is not set")
	void testGetAddressReturnsNullWhenNotSet() {
		var result = instance.getAddress();
		assertNull(result);
	}

	@Test
	@DisplayName("Verifies that getAddress returns empty string when address is set to empty")
	void testGetAddressReturnsEmptyStringWhenSetToEmpty() {
		instance.setAddress("");
		var result = instance.getAddress();
		assertEquals("", result);
	}

	@Test
	@DisplayName("Sets the address to a valid string and verifies the address is updated correctly using the getter")
	void testSetAddressWithValidValue() {
		instance.setAddress("123 Main St");
		assertEquals("123 Main St", instance.getAddress());
	}

	@Test
	@DisplayName("Sets the address to null and verifies the address is set to null")
	void testSetAddressWithNull() {
		instance.setAddress(null);
		assertNull(instance.getAddress());
	}

	@Test
	@DisplayName("Sets the address to an empty string and verifies the address is set to an empty string")
	void testSetAddressWithEmptyString() {
		instance.setAddress("");
		assertEquals("", instance.getAddress());
	}

}

package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import static org.junit.jupiter.api.Assertions.*;
import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.InjectMocks;
import org.mockito.Mock;
import static org.mockito.Mockito.*;
import static org.mockito.ArgumentMatchers.*;
import org.springframework.data.domain.Page;
import org.springframework.data.domain.PageRequest;
import org.springframework.data.domain.Pageable;
import java.util.List;
import org.springframework.ui.Model;
import org.mockito.junit.jupiter.MockitoExtension;

@ExtendWith(MockitoExtension.class)
class VetControllerTest {

	@Mock
	private VetRepository vetRepository;

	@Mock
	private Model model;

	@InjectMocks
	private VetController controller;

	@BeforeEach
	void setUp() {
		// Mockito initializes @Mock and @InjectMocks automatically
	}

	@Test
	@DisplayName("Returns 'vets/vetList' view when called with page 1 and a mock model, with paginated vets available")
	void testShowVetListWithPageOneReturnsVetListView() {
		Page<Vet> mockPage = mock(Page.class);
		Vet vet1 = new Vet();
		Vet vet2 = new Vet();
		when(mockPage.toList()).thenReturn(List.of(vet1, vet2));
		when(mockPage.getContent()).thenReturn(List.of(vet1, vet2));
		when(mockPage.getTotalPages()).thenReturn(3);
		when(mockPage.getTotalElements()).thenReturn(6L);
		when(vetRepository.findAll(any(Pageable.class))).thenReturn(mockPage);
		var result = controller.showVetList(1, model);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Returns 'vets/vetList' view when called with page 1 but no vets are found, resulting in empty vet list")
	void testShowVetListWithEmptyPageReturnsVetListView() {
		Page<Vet> mockPage = mock(Page.class);
		when(mockPage.toList()).thenReturn(List.of());
		when(mockPage.getContent()).thenReturn(List.of());
		when(mockPage.getTotalPages()).thenReturn(0);
		when(mockPage.getTotalElements()).thenReturn(0L);
		when(vetRepository.findAll(any(Pageable.class))).thenReturn(mockPage);
		var result = controller.showVetList(1, model);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Returns 'vets/vetList' view when called with page 2 and paginated vets are returned correctly")
	void testShowVetListWithPageTwoReturnsVetListView() {
		Page<Vet> mockPage = mock(Page.class);
		Vet vet = new Vet();
		when(mockPage.toList()).thenReturn(List.of(vet));
		when(mockPage.getContent()).thenReturn(List.of(vet));
		when(mockPage.getTotalPages()).thenReturn(3);
		when(mockPage.getTotalElements()).thenReturn(6L);
		when(vetRepository.findAll(any(Pageable.class))).thenReturn(mockPage);
		var result = controller.showVetList(2, model);
		assertNotNull(result);
	}

}
